import React, { Component } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

class Stock extends Component {
  dangerLevel = (date) => {
    const now = new Date();
    if (Date.parse(date) > now)
    return "caution"
  }
  render() {
    return (
      <tbody>
        <tr>
          <td>{this.props.stock.name}</td>
          <td className={this.dangerLevel(this.props.stock.date)}>{this.props.stock.date}</td>
          <td>
            <FontAwesomeIcon
              icon={["fas", "utensils"]}
              onClick={() => this.props.eatStocks(this.props.stock)}
            />
          </td>
        </tr>
      </tbody>
    );
  }
}

export default Stock;
